function [timeVec, chspec_ni_vec, chavg_ni_vec] = getEEG_NoiseAnalysis(fs, mtgLabels, mtgSignals, notched, notchFreqs)

    nSamples = size(mtgSignals,2);
    nrMtgs = size(mtgLabels,1);
    stepSize = fs*10;
    wdwSize = fs*10;
    ssVec = 1:stepSize:nSamples-wdwSize;
    timeVec = zeros(1, length(ssVec));
    chavg_ni_vec = zeros(1, length(ssVec));
    chspec_ni_vec = zeros(nrMtgs, length(ssVec));

    clc;
    polyOrder = 10;

    notchWidth = 5;
    harmonFreqs = [notchFreqs - notchWidth, notchFreqs + notchWidth];

    %% Get ideal spectrum
    [perfDataFreqs, perfDataModel] = getPerfEEGChannAvg_RegressionVals();
    [perfDataFreqs, perfDataModel] = get_discretized_ft(perfDataFreqs, perfDataModel, notched, harmonFreqs);

    for si = 1:length(ssVec)
        startSample = ssVec(si);
        endSample = startSample+wdwSize-1;
        timestamp = (startSample-1)/fs;
        dataWin = mtgSignals(:, startSample:endSample);

        channSpecNI = getPerfChannSpecNoiseIdx(fs, startSample, mtgLabels, dataWin, polyOrder, notched, harmonFreqs, perfDataFreqs, perfDataModel);
        %channSpecNI = getChannSpecNoiseIdx(fs, mtgLabels, dataWin, polyOrder);
        %chAvgNI = getChAvgNI(fs, mtgLabels, dataWin, polyOrder);

        chspec_ni_vec(:,si) = channSpecNI;
        chavg_ni_vec(si) = mean(channSpecNI);%chAvgNI;
        timeVec(si) = timestamp;
    end
end

function channSpecNI = getPerfChannSpecNoiseIdx(fs, startSample, mtgLabels, dataWin, polyOrder, notched, harmonFreqs, perfDataFreqs, perfDataModel)
    
    nSamples = size(dataWin,2);
    nrMtgs = size(mtgLabels,1);
    time = startSample/fs + (0:length(dataWin)-1)/fs;

    %% Get ChannSpec and ChannAvg Spectrum Regression
    fftFreqs = fs*(0:(nSamples/2))/nSamples;
    avgDataSpctrm = [];
    chDataSpctrmMat = [];
    cleanFreqs = [];
    for mi = 1:nrMtgs
        %Chann Spectrum
        chData = dataWin(mi,:);
        chData = chData - mean(chData);
        P2 = abs(fft(chData)/nSamples);
        chDataSpctrm = P2(1:nSamples/2+1);
        %chDataSpctrm(2:end-1) = 2*chDataSpctrm(2:end-1);
        %chDataSpctrm = real(chDataSpctrm);
        %chDataSpctrm = chDataSpctrm(~delSel);
        %chDataSpctrm(1) = chDataSpctrm(2);
        chDataSpctrm = movmean(chDataSpctrm,10);
        chDataSpctrm = rescale(log10(chDataSpctrm));

        [cleanFreqs, chDataSpctrm] = get_discretized_ft(fftFreqs, chDataSpctrm, notched, harmonFreqs);

        if isempty(avgDataSpctrm)
            avgDataSpctrm = chDataSpctrm;
        else
            avgDataSpctrm = avgDataSpctrm+chDataSpctrm;
        end
        chDataSpctrmMat = cat(1, chDataSpctrmMat, chDataSpctrm);
    end
    avgDataSpctrm = avgDataSpctrm/nrMtgs;
    [p, S] = polyfit(cleanFreqs, avgDataSpctrm, polyOrder);
    [avgDataModelY, ~] = polyval(p, cleanFreqs, S);

    channSpecNI = zeros(nrMtgs, 1);
    for mi = 1:nrMtgs

        %% NI_1, Channel Spectrum vs Channel Model, catch artefats that don't follow a linear adjustment to teh spctrm
        chDataSpctrm = chDataSpctrmMat(mi,:);
        [p, S] = polyfit(cleanFreqs, chDataSpctrm, polyOrder);
        [chSpecModelY, ~] = polyval(p, cleanFreqs, S);
        ssr = sum((chDataSpctrm-chSpecModelY).^2);
        sst = sum((chDataSpctrm-mean(chDataSpctrm)).^2);
        chSpecModelR2 = ssr/sst;
        if chSpecModelR2 > 1
            chSpecModelR2 = 1;
        end
        %% NI_2, Channel Model vs Ch.Average Model, catch artifcats based on a clean spectrum (i.e. ch.avg.spctrm)
        ssr = sum((avgDataModelY-chSpecModelY).^2);
        sst = sum((avgDataModelY-mean(avgDataModelY)).^2);
        chSpecChAvgModelsR2 = ssr/sst;
        if chSpecChAvgModelsR2 > 1
            chSpecChAvgModelsR2 = 1;
        end
        %% N_3, Channel Model vs Ideal Model, catch artefacts in case all channels artifactual
        ssr = sum((perfDataModel-chSpecModelY).^2); % Residual Sum-Of-Squares
        sst = sum((perfDataModel-mean(perfDataModel)).^2); % Total Sum-Of-Squares
        avgData_PerfData_R2 = ssr/sst;
        if avgData_PerfData_R2>1
            avgData_PerfData_R2 = 1;
        end

        if chSpecChAvgModelsR2 > avgData_PerfData_R2
            chNI = mean([chSpecModelR2, chSpecChAvgModelsR2]);
        else
            chNI = mean([chSpecModelR2, avgData_PerfData_R2]);
        end
        chNI = mean([chSpecModelR2, chSpecChAvgModelsR2, avgData_PerfData_R2]);
        %chNI = mean([chSpecModelR2, chSpecChAvgModelsR2]);
        channSpecNI(mi) = chNI;

        ss = 2200*1024;
        chpidx = 3;
        plotOk = (mi == chpidx && startSample > ss-500 && startSample < ss+500);
        if plotOk
            close all;
            subplot(3,4,1)
            chData = dataWin(mi,:);
            plot(time, chData, '-k');
            legend("Chann.Signal")
            title(mtgLabels{mi})
            
            subplot(3,4,5)
            bpChData = getBandpassedSignal(fs, 512, 80, 500,chData);
            plot(time, bpChData, '-k');
            ylim([prctile(bpChData,0.15), prctile(bpChData,99.85)])
            legend("BP Chann.Signal")
            title({strcat("Bandpassed ", mtgLabels{mi}); "(80-500 Hz)"})
            set(gcf, 'Position', get(0, 'Screensize'), 'color','w');
            
            %% N_1
            subplot(3,4,[2 6])
            plot(cleanFreqs, chDataSpctrm, '-k'); hold on;
            plot(cleanFreqs, chSpecModelY, '-r', 'LineWidth', 2); hold on;
            legend("Chann.Spctrm", "Chann.SpctrmModel");
            titleStr = {"NI_1, Channel Spectrum"; "vs"; "Channel Spectrum Model"; strcat("NI_1 = ", num2str(chSpecModelR2, '%.2f'))};
            title(titleStr)
            
            %% N_2
            subplot(3,4,[3 7])
            plot(cleanFreqs, chDataSpctrm, '-k'); hold on;
            plot(cleanFreqs, avgDataSpctrm, '-', 'LineWidth', 1, 'Color', [0.9290 0.6940 0.1250]); hold on;
            plot(cleanFreqs, avgDataModelY, '-', 'LineWidth', 2, 'Color', [0.4660 0.6740 0.1880]); hold on;
            legend("Chann.Spctrm","Avg.Chann.Spctrm", "Avg.Chann.Spctrm.Model");
            titleStr = {"NI_2, Channel Spectrum"; "vs"; "Avg.Channel Spectrum Model"; strcat("NI_2 = ", num2str(chSpecChAvgModelsR2, '%.2f'))};
            title(titleStr)
            
            %% N_3
            subplot(3,4,[4 8])
            plot(cleanFreqs, chDataSpctrm, '-k'); hold on;
            plot(cleanFreqs, avgDataSpctrm, '-', 'LineWidth', 1, 'Color', [0.9290 0.6940 0.1250]); hold on;
            plot(cleanFreqs, avgDataModelY, '-', 'LineWidth', 2, 'Color', [0.4660 0.6740 0.1880]); hold on;
            plot(cleanFreqs, perfDataModel, '-', 'LineWidth', 2, 'Color', [0.4940 0.1840 0.5560]); hold on;
            legend("Chann.Spctrm","Avg.Chann.Spctrm", "Avg.Chann.Spctrm.Model", "Ideal Spctrm");
            titleStr = {"NI_3, Avg.Channel Spectrum Model"; "vs"; "Ideal Spectrum"; strcat("NI_3 = ", num2str(avgData_PerfData_R2, '%.2f'))};
            title(titleStr)
            
            sgtitle({mtgLabels{mi}; strcat("Channel Specfic NI:", num2str(chNI, '%.2f'))});
            
            set(gcf, 'Position', get(0, 'Screensize'), 'color','w');
            % figFilename = strcat("F:\Postdoc_Calgary\Presentations\images\", mtgLabels{mi}, '_ChannSpec_N2', '.png');
            % %saveas(gcf,figFilename);
            close();
        end
    end
end

function [dscrt_freqs, dscrt_pow] = get_discretized_ft(freq_vec, power_vec, notched, notch_freqs)

    dscrt_freqs = 1:1:500;
    dscrt_pow = zeros(1, length(dscrt_freqs));

    %% Delete discretized frequencies within notch filters
    delSel = false(1, length(dscrt_freqs));
    if notched
        for hfi = 1:length(notch_freqs)
            selVec = dscrt_freqs >= notch_freqs(hfi,1) & dscrt_freqs <= notch_freqs(hfi,2);
            delSel(selVec) = true;
        end
    end
    dscrt_freqs(delSel) = [];
    dscrt_pow(delSel) = [];

    %% Delete signal  frequencies within notch filters
    delSel = false(1, length(freq_vec));
    if notched
        for hfi = 1:length(notch_freqs)
            selVec = freq_vec >= notch_freqs(hfi,1) & freq_vec <= notch_freqs(hfi,2);
            delSel(selVec) = true;
        end
    end
    freq_vec(delSel) = [];
    power_vec(delSel) = [];

    for idx = 1:length(dscrt_freqs)
        if idx == 1
            selvec = freq_vec <= dscrt_freqs(idx);
        else
            selvec = (freq_vec <= dscrt_freqs(idx)) & (freq_vec > dscrt_freqs(idx-1));
        end
        %freq_vec(selvec);
        dscrt_pow(idx) = mean(power_vec(selvec));
    end
end

function channSpecNI = getChannSpecNoiseIdx(fs, mtgLabels, dataWin, polyOrder)
    
    nSamples = size(dataWin,2);
    nrMtgs = size(mtgLabels,1);
    if nrMtgs <= 10
        channSpecNI = NaN(1, nrMtgs);
        return;
    end

    fftFreqs = fs*(0:(nSamples/2))/nSamples;
    delSel = (fftFreqs < 1) | (fftFreqs > 341.33);
	fftFreqs(delSel) = [];

    avgDataSpctrm = zeros(1, length(fftFreqs));
    chSpecModelYVec = zeros(nrMtgs, length(fftFreqs));
    chSpecModelR2Vec = zeros(nrMtgs,1);

    for mi = 1:nrMtgs
        %Chann Spectrum
        chData = dataWin(mi,:);
        P2 = abs(fft(chData)/nSamples);
        chDataSpctrm = P2(1:nSamples/2+1);
        chDataSpctrm(2:end-1) = 2*chDataSpctrm(2:end-1);
        chDataSpctrm = real(chDataSpctrm);
        chDataSpctrm = chDataSpctrm(~delSel); 
        avgDataSpctrm = avgDataSpctrm+chDataSpctrm;

        %Chann Spec Spectrum Regression
        chDataSpctrm = movmean(chDataSpctrm,10);
        chDataSpctrm = rescale(log10(chDataSpctrm));
        [p, S] = polyfit(fftFreqs, chDataSpctrm, polyOrder);
        [chSpecModelY, ~] = polyval(p, fftFreqs, S);
        chSpecModelYVec(mi,:) = chSpecModelY;
        %Get error from chann spec regression
        ssr = sum((chDataSpctrm-chSpecModelY).^2);
        sst = sum((chDataSpctrm-mean(chDataSpctrm)).^2);
        chSpecModelR2 = ssr/sst;
        chSpecModelR2Vec(mi) = chSpecModelR2;

        % close all;
        % subplot(3,3,1)
        % plot((0:length(chData)-1)/fs, chData, '-k');
        % legend("Chann.Signal ")
        % title(mtgLabels{mi})
        % 
        % subplot(3,3,2)
        % plot(fftFreqs, chDataSpctrm, '-k'); hold on;
        % plot(fftFreqs, chSpecModelY, '-r', 'LineWidth', 2); hold on;
        % legendStr = strcat("Chann ModelFFT (NI_1: ", num2str(chSpecModelR2, '%.2f'), ")");
        % legend("ChannFFT", legendStr);
        % 
        % set(gcf, 'Position', get(0, 'Screensize'), 'color','w');
        % figFilename = strcat("F:\Postdoc_Calgary\Presentations\images\", mtgLabels{mi}, '_ChannSpec_N1', '.png');
        % saveas(gcf,figFilename);
        % close();
    end

    %Chann Avg Spectrum Regression
    avgDataSpctrm = avgDataSpctrm/nrMtgs;
    avgDataSpctrm = rescale(log10(avgDataSpctrm));
    [p, S] = polyfit(fftFreqs, avgDataSpctrm, polyOrder);
    [avgDataModelY, ~] = polyval(p, fftFreqs, S);
    
    channSpecNI = zeros(nrMtgs, 1);
    for mi = 1:nrMtgs
        chSpecModelR2 = chSpecModelR2Vec(mi);
        chSpecModelY = chSpecModelYVec(mi,:);

        % Get error between chann spec and chann avg regression
        ssr = sum((avgDataModelY-chSpecModelY).^2);
        sst = sum((avgDataModelY-mean(avgDataModelY)).^2);
        chSpecChAvgModelsR2 = ssr/sst;
        if chSpecChAvgModelsR2 > 1
            chSpecChAvgModelsR2 = 1;
        end

        chNI = mean([chSpecModelR2, chSpecChAvgModelsR2]);
        channSpecNI(mi) = chNI;

        % close all;
        % subplot(3,3,3)
        % plot(fftFreqs, avgDataSpctrm, '-k'); hold on;
        % plot(fftFreqs, avgDataModelY, '-r', 'LineWidth', 2); hold on;
        % plot(fftFreqs, chSpecModelY, '-g', 'LineWidth', 2); hold on;
        % legendStr = strcat("ChannModelFFT (NI_2", num2str(chSpecChAvgModelsR2, '%.2f'), ")");
        % legend("Avg.Chann FFT", "Avg.Chann ModelFFT", legendStr);
        % sgtitle({mtgLabels{mi}; strcat("Channel Specfic NI:", num2str(chNI, '%.2f'))});
        % 
        % set(gcf, 'Position', get(0, 'Screensize'), 'color','w');
        % figFilename = strcat("F:\Postdoc_Calgary\Presentations\images\", mtgLabels{mi}, '_ChannSpec_N2', '.png');
        % saveas(gcf,figFilename);
        % close();
    end
end

function [goodSpctrmCnt, goodSpctrmSum] = getChannPerfCompareNI(fs, mtgLabels, dataWin, polyOrder)
    
    nSamples = size(dataWin,2);
    nrMtgs = size(mtgLabels,1);
    if nrMtgs <= 10
        channSpecNI = NaN(1, nrMtgs);
        return;
    end

    fftFreqs = fs*(0:(nSamples/2))/nSamples;
    delSel = (fftFreqs < 1) | (fftFreqs > 341.33);
	fftFreqs(delSel) = [];

    chSpecModelR2Vec = zeros(nrMtgs,1);
    goodSpctrmSum = [];
    goodSpctrmCnt = 0;
    for mi = 1:nrMtgs
        %Chann Spectrum
        chData = dataWin(mi,:);
        P2 = abs(fft(chData)/nSamples);
        chDataSpctrm = P2(1:nSamples/2+1);
        chDataSpctrm(2:end-1) = 2*chDataSpctrm(2:end-1);
        chDataSpctrm = real(chDataSpctrm);
        chDataSpctrm = chDataSpctrm(~delSel); 

        %Chann Spec Spectrum Regression
        chDataSpctrm = movmean(chDataSpctrm,10);
        chDataSpctrm = rescale(log10(chDataSpctrm));
        [p, S] = polyfit(fftFreqs, chDataSpctrm, polyOrder);
        [chSpecModelY, ~] = polyval(p, fftFreqs, S);

        [perfDataFreqs, perfDataModel] = getPerfEEGChannAvg_RegressionVals();


        ssr = sum((perfDataModel-chSpecModelY).^2);
        sst = sum((perfDataModel-mean(perfDataModel)).^2);
        chSpecModelR2 = ssr/sst;
        chSpecModelR2Vec(mi) = chSpecModelR2;

        if chSpecModelR2 <= 0.05
            if isempty(goodSpctrmSum)
                goodSpctrmSum = chSpecModelY;
            else
                goodSpctrmSum = goodSpctrmSum+chSpecModelY;
            end
            goodSpctrmCnt = goodSpctrmCnt+1;

            plot(fftFreqs, chDataSpctrm); hold on;
            plot(fftFreqs, chSpecModelY); hold on;
            plot(fftFreqs, perfDataModel); hold on;
            legend("Chann.Signal FFT", "Chann.Signal ", "Perfect Data Model")
            title({mtgLabels{mi}; strcat("R^2: ", num2str(chSpecModelR2, '%.2f'))})
            close();
        end
    end
end

function wdwNI = getChAvgNI(fs, mtgLabels, dataWin, polyOrder)
    
